// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Tournament {
    // 
    struct Match {
        uint256 matchNumber;
        uint256 winnerId;
        uint256 winnerScore;
        uint256 loserId;
        uint256 loserScore;
    }

    // 
    mapping(uint256 => Match) public matches;

    // 
    uint256 public matchCount;

    // 
    address public owner;

    // 
    event MatchRecorded(
        uint256 matchNumber,
        uint256 winnerId,
        uint256 winnerScore,
        uint256 loserId,
        uint256 loserScore
    );

    // 
    modifier onlyOwner() {
        require(msg.sender == owner, "Caller is not the owner");
        _;
    }

    // 
    constructor() {
        owner = msg.sender;
    }

    //  
    function recordMatch(
        uint256 winnerId,
        uint256 winnerScore,
        uint256 loserId,
        uint256 loserScore
    ) public onlyOwner {
        matchCount++;
        matches[matchCount] = Match({
            matchNumber: matchCount,
            winnerId: winnerId,
            winnerScore: winnerScore,
            loserId: loserId,
            loserScore: loserScore
        });

        // MatchRecorded
        emit MatchRecorded(
            matchCount,
            winnerId,
            winnerScore,
            loserId,
            loserScore
        );
    }

    // 
    function getMatch(uint256 matchNumber) public view returns (
        uint256 winnerId,
        uint256 winnerScore,
        uint256 loserId,
        uint256 loserScore
    ) {
        Match memory m = matches[matchNumber];
        return (m.winnerId, m.winnerScore, m.loserId, m.loserScore);
    }
}
